        double a, b, interval, sum;
        int n,i;
        double left;
        while (sc.hasNext()) {
            a = sc.nextDouble();
            b = sc.nextDouble();
            n = sc.nextInt();
            interval = (b - a) / n;
            sum = 0;

            for (i=0, left= a; i < n; i++) {
                double tmp = (left * left + (left + interval) * (left + interval)) * interval / 2;
