public class Main {
    public static int existQ(final int n, final int range, final int[] arr) {
        for (int i = 0; i <= range; ++i) {
            if (arr[i] == n) return i;
        }
        return -1;
    }

    public static void main(String[] args) {
        int[] num = new int[1024];
        int[] cnt = new int[1024];
        int m = -1;
        int p = 0;
        int cur = 0;
        Scanner sc = new Scanner(System.in);
        while (sc.hasNext()) {
            int x = sc.nextInt();
            int pos = existQ(x, cur, num);
            if (pos == -1) {
                ++cur;
                num[cur] = x;
                cnt[cur] = 1;
            } else {
                ++cnt[pos];
            }
        }
        for (int i = 0; i <= cur; ++i) {
            if (cnt[i] > m) {
                m = cnt[i];
                p = i;
            }
        }
        System.out.printf("%d %d", num[p], cnt[p]);
    }
}

