        Scanner sc = new Scanner(System.in);
        final int[] DAYS = {0, 31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31};
        int year = sc.nextInt(), month = sc.nextInt(), day = sc.nextInt();
        if (year < 1820 || year > 2020 || month < 1 || month > 12 || day < 1 || day > 31) {
            System.out.println("Wrong Format");
            return;
        }
        GregorianCalendar gc = new GregorianCalendar(year, month - 1, 1);
        if (month != 2) {
            if (day > DAYS[month]) {
                System.out.println("Wrong Format");
                return;
            }
        }
        if (gc.isLeapYear(year)) {
            if (month == 2) {
                if (day > 29) {
                    System.out.println("Wrong Format");
                    return;
                }
            }
        }else {
            if (month == 2) {
                if (day > 28) {
                    System.out.println("Wrong Format");
                    return;
                }
            }
        }
        gc = new GregorianCalendar(year, month - 1, day);
        System.out.print(year + " is ");
        if (!gc.isLeapYear(year)) System.out.print("not ");
        System.out.println("a leap year.");
