            if (month == 2) {
                if (day > 29) {
                    System.out.println("Wrong Format");
                    return;
                }
            }
        }else {
            if (month == 2) {
                if (day > 28) {
                    System.out.println("Wrong Format");
                    return;
                }
            }
        }
        gc = new GregorianCalendar(year, month - 1, day);
        int delta = sc.nextInt();
        gc.add(Calendar.DATE, -delta);
        System.out.printf("%d days ago is:%d-%d-%d\n", delta, gc.get(Calendar.YEAR), gc.get(Calendar.MONTH) + 1, gc.get(Calendar.DATE));
    }
}

