        int a[] = new int[n];
        int b[] = new int[n];
        for (i = 0; i < n; i++)
        {
            a[i]=in.nextInt(); //a[i] == a + i
        }
        for (i = 0; i < n; i++) //记录每个数字出现的次数，每个数字至少出现一次，使用数组b[i]保存下来次数。
        {
            for (j = 0; j < n; j++)
            {
                if (a[i] == a[j])
                {
                    b[i]++;  //把遇到的重复的数字存在 b数组中，每次遇见相同的都累加，对应的下标即为他的原来数字a[i]
                }
            }
        }
        max = b[0];
        for (i = 1; i < n; i++) //查找最大的次数，记住最大次数的下标，使用该下标找到出现次数最大的数字。
        {
            if (max < b[i])
            {
                max = b[i];
                index = i;
            }
        }
        System.out.printf("%d %d\n",a[index], max);
    }
}

