public class Main{ 
		public static void main(String[] args) {
			Scanner in = new Scanner(System.in);
			int aa[]=new int [100];
			int i=0;
			int d=0;
			try {
				while(d!=4)
				{
				int a=in.nextInt();
			if(a>9||a<0)
				{System.out.println("Numerical range error");
			   return;}
			else
				aa[i]=a;
			i++;
			d++;
				}
			}
			catch(Exception e)
			{
				System.out.println("number input error");
				return;
			}
			   for (int j = 0; j < i; ++j) {
		            // 提前退出冒泡循环的标志位,即一次比较中没有交换任何元素，这个数组就已经是有序的了
		            boolean flag = false;
		            for (int k = 0; k < i- j - 1; ++k) {        //此处你可能会疑问的j<n-j-1，因为冒泡是把每轮循环中较大的数飘到后面，
		                // 数组下标又是从0开始的，j下标后面已经排序的个数就得多减1，总结就是j增多少，j的循环位置减多少
		                if (aa[k] > aa[k + 1]) {        //即这两个相邻的数是逆序的，交换
		                    int temp = aa[k];
		                    aa[k] = aa[k + 1];
		                    aa[k + 1] = temp;
		                    flag = true;
		                }
		            }
		            if (!flag) break;//没有数据交换，数组已经有序，退出排序
		        }
			int y=0;
			for(int w=0;w<i;w++)
			{
				if(aa[w]==0)
					y++;
				else
				break;
					
			}
