				System.out.printf("0");
				System.out.printf(" ");
				System.out.printf("0");
				
				return;
			}
			for(int f=0;f<i;f++)
			{
				System.out.printf("%d",aa[i-f-1]);
			}
			
			System.out.printf(" ");
				
			
					if(aa[0]==0)
					{for(int f=0;f<i-y;f++)
					{
		                System.out.printf("%d",aa[f+y]);
					}
					}
					else
					{
					for(int f=0;f<i;f++)
					{
						System.out.printf("%d",aa[f]);
			}
					}
		}
		
}

