public class Main {
    //判断是否是闰年
    public static boolean isLeapYear(int year){
        boolean isleapyear;
        if((year%4==0 && year%100!=0) || year%400==0){
            isleapyear=true;
        }else{
            isleapyear=false;
        }
        return isleapyear;
    }
    //计算天数
    public static int numOfDays(int year,int month ,int day) {
        int num=0;
            for (int i = 1; i <=(year-1); i++) //不算 year当年 的总天数
            {
                if (isLeapYear(i)) {
                    num+=366;
                }else{
                    num+=365;
                }
            }
            //现在开始计算本年的天数

                int u = 0;


                for (int i = 1; i <= 12; i++) {
                    if (i == 2) {
                        if (isLeapYear(year)) {
                            u = 29;
                        } else {
                            u = 28;
                        }

                    } else if (i == 4 ||i == 6 || i == 9 || i == 11) {
                        u = 30;
                    } else {
                        u = 31;
                    }

                    if (month > i) {
                        num += u;

                    } else if(month ==i){
                        num += day;
                    }else{
                        num+=0;
                    }
                }

        return num;
    }
    //确定星期几
    public static String getWhatDay(int days){
        int d = days%7;
        String s="";
        switch (d){
            case(0):
                s="Sunday";
                break;
            case(1):
                s="Monday";
                break;
            case(2):
                s="Tuesday";
                break;
            case(3):
                s="Wednesday";
                break;
            case(4):
                s="Thursday";
                break;
            case(5):
                s="Friday";
                break;
            case(6):
                s="Saturday";

        }
        return s;
    }
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        int year = in.nextInt();
        int month = in.nextInt();
        int day = in.nextInt();
        boolean standard =false;
        if(year>=1820&&year<=2020&&month>=1&&month<=12&&day>=1){
            if(month==2){
                if(isLeapYear(year)){
                    if(day<=29){
                        standard=true;
                    }
                }else{
                    if(day<=28){
                        standard=true;
                    }
                }
            }else if(month==4||month==6||month==9||month==11){
                if(day<=30){
                    standard=true;
                }
            }else{
                if(day<=31){
                    standard=true;
                }
            }
        }
        if(standard){
            if(isLeapYear(year)){
                System.out.println(year+" is a leap year.");
            }else{
                System.out.println(year+" is not a leap year.");
            }

            int days = numOfDays(year,month,day);
            System.out.println(year+"-"+month+"-"+day+" is "+getWhatDay(days)+".");

        }else{
            System.out.println("Wrong Format");
        }
    }
}

