class GIRL {
    String name;
    int height;
    int age;
    String tel;

    public GIRL(String name, int height, int age, String tel) {
        this.name = name;
        this.height = height;
        this.age = age;
        this.tel = tel;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (o == null || getClass() != o.getClass()) return false;
        GIRL girl = (GIRL) o;
        return height == girl.height && age == girl.age && Objects.equals(name, girl.name) && Objects.equals(tel, girl.tel);
    }

    @Override
    public int hashCode() {
        return Objects.hash(name, height, age, tel);
    }

    @Override
    public String toString() {
        return name + " " + height + " " + age + " " + tel;
    }
}

