import java.util.ArrayList;
import java.util.Collections;
import java.util.Comparator;
import java.util.List;
import java.util.Scanner;
import java.util.Objects;

public class Main {

	public static void main(String[] args) {
		Scanner in=new Scanner(System.in);
		String name;
		int h,age;
		String tel;
		while(in.hasNext())
		{
			int n=in.nextInt();
			int a=in.nextInt();
			int b=in.nextInt();
			int c=in.nextInt();
			int d=in.nextInt();
			List<Girl> list=new ArrayList<Girl>();
			for(int i=0;i<n;i++)
			{
				name=in.next();
				h=in.nextInt();
				age=in.nextInt();
				tel=in.next();
				Girl s=new Girl(name, h, age, tel);
				if(s.h>=a&&s.h<=b&&s.age>=c&&s.age<=d&&!list.contains(s))
				{
					list.add(s);
				}
			}
			System.out.println(list.size());
			Collections.sort(list, new Comparator<Girl>() {

				@Override
				public int compare(Girl o1, Girl o2) {
					if(o2.h-o1.h!=0)
					{
						return o1.h-o2.h;
					}
					else 
					{
						return o2.age-o1.age;
					}
				}

			});
			for(Object girl:list)
			{
				System.out.println(girl);
			}
		}
		in.close();

	}
}

class Girl {
	String name;
	int h,age;
	String tel;
	public Girl(String name, int h, int age, String tel) {
		super();
		this.name = name;
		this.h = h;
		this.age = age;
		this.tel = tel;
	}
	@Override
	public int hashCode() {
		return Objects.hash(age, h, name, tel);
	}
	@Override
	public boolean equals(Object obj) {
		if (this == obj)
			return true;
		if (obj == null)
			return false;
		if (getClass() != obj.getClass())
			return false;
		Girl other = (Girl) obj;

		return age == other.age && h == other.h && Objects.equals(name, other.name) && Objects.equals(tel, other.tel);
	}
	@Override
	public String toString() {
		return name+" "+h+" "+age+" "+tel;
	}

}

