class Rectangle{
    double width;
    double height;

    public Rectangle(double a,double b){
        this.width=a;
        this.height=b;
    }

    public double getArea(){
        return this.width*this.height;
    }

    public double getPerimeter(){
        return (this.width+this.height)*2;
    }

    public void show(){
        System.out.println(this.width+" "+this.height+" "+this.getArea()+" "+this.getPerimeter());
    }
}

