import java.util.Scanner;
public class Main{
	public static void main(String[] args){
		Scanner sc = new Scanner(System.in);
		String str = sc.nextLine();
		sc.close();
		count(str);
	}
	private static void count(String str) {
		int countLetter = 0;
		int countNumber = 0;
		int countSpace = 0;
		int countOther = 0;
		for (int i=0; i<str.length(); i++) {
			if(('a' <= str.charAt(i))&&('z' >= str.charAt(i)) //字母
				||('A' <= str.charAt(i))&&('Z' >= str.charAt(i))) {
				countLetter++;
			}else if(('0' <= str.charAt(i))&&('9' >= str.charAt(i))) { //数字
				countNumber++;
			}else if(' ' == str.charAt(i)) { //空格
				countSpace++;
			}
			else { //其他
				countOther++; 
			}
		}
		System.out.println("字母个数：" + countLetter);
		System.out.println("数字个数：" + countNumber);
		System.out.println("空格个数：" + countSpace);
		System.out.println("其他字符个数：" + countOther);
	}
}

