import java.util.*;

public class Main{
    public static void main(String[] args) {
        Scanner reader = new Scanner(System.in);
        String input = reader.nextLine();
        int numCount = 0;
        int charCount = 0;
        int spaceCount = 0;
        for (int i = 0;i < input.length();i++) {
            char charactor = input.charAt(i);
            if (charactor <= '9' && charactor >= '0') {
                numCount++;
            }
            if ((charactor >= 'A' && charactor <= 'Z') || (charactor >= 'a' && charactor <= 'z')) {
                charCount++;
            }
            if (charactor == ' '){
                spaceCount++;
            }
        }
        System.out.println("字母个数：" + charCount);
        System.out.println("数字个数：" + numCount);
        System.out.println("空格个数：" + spaceCount);
        System.out.println("其他字符个数：" + (input.length()-charCount-numCount-spaceCount));

        reader.close();
    }
}

