		String [] students = reader.nextLine().split(",");
		String [] result = new String[students.length];
		for(int i = 0;i < students.length;i++) {
			String [] informations = students[i].split("\\\\s");
			result[i] = informations[0] + " " + (gradeStringToNumber(informations[1]) + gradeStringToNumber(informations[2]));
		}
		for  (int i = 0;i < result.length;i++) {
			System.out.print(result[i]);
			if  (i != result.length - 1) {
				System.out.print(",");
			}
		}
		System.out.println();
		reader.close();
	}

	static int gradeStringToNumber(String string) {
		int result = 0;
		switch (string) {
			case "A":
				result = 5;
				break;

			case "B":
				result = 4;
				break;

			case "C":
				result = 3;
				break;

			case "D":
				result = 2;
				break;

			case "E":
				result = 1;
				break;

		}
		return result;
	}
}

