        Scanner in = new Scanner(System.in);
        BigInteger a,b,x,y,z,p,t;
        int n = in.nextInt();
        while(n!=0){
            n--;
            a = in.nextBigInteger();
            b = in.nextBigInteger();
            x = a.add(b);
            y = a.subtract(b);
            z = a.multiply(b);
            p = a.divide(b);
            t = a.remainder(b);
            System.out.println(a+"+"+b+"="+x);
            System.out.println(a+"-"+b+"="+y);
            System.out.println(a+"*"+b+"="+z);
            System.out.println(a+"/"+b+"="+p);
            System.out.println(a+"%"+b+"="+t);
        }
        return;
    }
}

